CREATE TABLE DATA(
 DEVICE VARCHAR(255) NOT NULL,
 IMAGE_WIDTH INT NOT NULL,
 IMAGE_HEIGHT INT NOT NULL,
 FACET_SIZE INT NOT NULL,
 DEFORMATION_COUNT INT NOT NULL,
 TEST_CASE INT NOT NULL,
 VARIANT INT NOT NULL,
 LWS0 INT NOT NULL,
 LWS1 INT NOT NULL,
 LWS_SUB INT NOT NULL,
 FACET_COUNT INT NOT NULL,
 DATASIZE INT NOT NULL,
 TIME_TOTAL DOUBLE NOT NULL,
 TIME_KERNEL DOUBLE NOT NULL,
 STATE VARCHAR(255) NOT NULL,
 RESULT_GROUP INT NOT NULL,
 primary key (DEVICE, IMAGE_WIDTH, IMAGE_HEIGHT, DEFORMATION_COUNT, FACET_SIZE, TEST_CASE, VARIANT, LWS0, LWS1, LWS_SUB) 
);